/* ==UserStyle==
@name           Custom Roblox ATEEZ Theme
@namespace      roblox.com
@version        1.0
@description    A dark blue theme for Roblox with ATEEZ background
@author         Your Name
@preprocessor   stylus
==/UserStyle== */
@-moz-document domain("roblox.com") {
/* General background and text colors */
  body, html {
    background-color: #001f3f !important;
    color: #e0e0e0 !important;
    background-image: url('https://i.imgur.com/rQ5E1gS.jpg') !important;
    background-size: cover !important;
    background-attachment: fixed !important;
  }

  /* Header */
  .navbar, .navbar-container {
    background-color: #002d5c !important;
  }
  
  /* Buttons */
  .btn-primary, .btn-primary--inline {
    background-color: #004080 !important;
    border-color: #004080 !important;
  }
  .btn-primary:hover, .btn-primary--inline:hover {
    background-color: #0059b3 !important;
    border-color: #0059b3 !important;
  }
  
  /* Sidebar */
  .left-col, .right-col {
    background-color: #001a33 !important;
  }
  
  /* Cards */
  .container-header, .container-body, .card-item {
    background-color: rgba(0, 0, 0, 0.7) !important;
    border: 1px solid #003366 !important;
  }
  
  /* Links */
  a, .text-link {
    color: #66a3ff !important;
  }
  a:visited, .text-link:visited {
    color: #4d88ff !important;
  }
  a:hover, .text-link:hover {
    color: #80b3ff !important;
  }
  
  /* Footer */
  .footer {
    background-color: #002d5c !important;
  }
  
  /* Additional styles */
  .container, .row, .col, .main-content {
    background: none !important;
  }
  
  /* Specific to Roblox elements */
  .rbx-body, .rbx-navbar, .rbx-footer, .section-content {
    background: none !important;
  }
}
